import React from 'react';
import { Link } from 'react-router-dom';

function Introduction(props) {
  return (
    <div>
      <h1>Hi, my name is Noah.</h1>
      <h3>
        I am a UX/UI Designer interested in leveraging technology to make
        people's lives more efficient and happier. <br />
        <br />I have previously worked at Luxrobo, Giant Shoulders, and Weddell
        Co. to build products from scratch. I am currently looking for new
        opportunities after studying Industrial Design at Rhode Island School of
        Design.
      </h3>
      <button>Resume</button>
      <Link to="https://www.linkedin.com/in/noahsjung/" targer="blank">
        <button type="button">Linkedin</button>
      </Link>
    </div>
  );
}

export default Introduction;
